int ZcmLidarLuxObject_decode(const void* buf, uint32_t offset, uint32_t maxlen, ZcmLidarLuxObject* p)
{
    uint32_t pos = 0;
    int thislen;
    int64_t hash = __ZcmLidarLuxObject_get_hash();

    int64_t this_hash;
    thislen = __int64_t_decode_array(buf, offset + pos, maxlen - pos, &this_hash, 1);
    if (thislen < 0) return thislen; else pos += thislen;
    if (this_hash != hash) return -1;

    thislen = __ZcmLidarLuxObject_decode_array(buf, offset + pos, maxlen - pos, p, 1);
    if (thislen < 0) return thislen; else pos += thislen;

    return pos;
}

