        n += __int32_t_clone_array(&(p[element].absVelSigmaY), &(q[element].absVelSigmaY), 1);

        n += __ZcmLidarLux2DPoint_clone_array(&(p[element].relVelocity), &(q[element].relVelocity), 1);

        n += __int8_t_clone_array(&(p[element].objectClass), &(q[element].objectClass), 1);

        n += __int32_t_clone_array(&(p[element].classAge), &(q[element].classAge), 1);

