int ZcmLidarLuxObject_publish(zcm_t* zcm, const char* channel, const ZcmLidarLuxObject* p)
{
      uint32_t max_data_size = ZcmLidarLuxObject_encoded_size (p);
      uint8_t* buf = (uint8_t*) malloc (max_data_size);
      if (!buf) return -1;
      int data_size = ZcmLidarLuxObject_encode (buf, 0, max_data_size, p);
      if (data_size < 0) {
          free (buf);
          return data_size;
      }
      int status = zcm_publish (zcm, channel, buf, (uint32_t)data_size);
      free (buf);
      return status;
}

struct _ZcmLidarLuxObject_subscription_t {
    ZcmLidarLuxObject_handler_t user_handler;
    void* userdata;
    zcm_sub_t* z_sub;
};
static
void ZcmLidarLuxObject_handler_stub (const zcm_recv_buf_t* rbuf,
                            const char* channel, void* userdata)
{
    int status;
    ZcmLidarLuxObject p;
    memset(&p, 0, sizeof(ZcmLidarLuxObject));
    status = ZcmLidarLuxObject_decode (rbuf->data, 0, rbuf->data_size, &p);
    if (status < 0) {
        fprintf (stderr, "error %d decoding ZcmLidarLuxObject!!!\n", status);
        return;
    }

    ZcmLidarLuxObject_subscription_t* h = (ZcmLidarLuxObject_subscription_t*) userdata;
    h->user_handler (rbuf, channel, &p, h->userdata);

    ZcmLidarLuxObject_decode_cleanup (&p);
}

ZcmLidarLuxObject_subscription_t* ZcmLidarLuxObject_subscribe (zcm_t* zcm,
                    const char* channel,
                    ZcmLidarLuxObject_handler_t f, void* userdata)
{
    ZcmLidarLuxObject_subscription_t* n = (ZcmLidarLuxObject_subscription_t*)
                       malloc(sizeof(ZcmLidarLuxObject_subscription_t));
    n->user_handler = f;
    n->userdata = userdata;
    n->z_sub = zcm_subscribe (zcm, channel,
                              ZcmLidarLuxObject_handler_stub, n);
    if (n->z_sub == NULL) {
        fprintf (stderr,"couldn't reg ZcmLidarLuxObject ZCM handler!\n");
        free (n);
        return NULL;
    }
    return n;
}

int ZcmLidarLuxObject_unsubscribe(zcm_t* zcm, ZcmLidarLuxObject_subscription_t* hid)
{
    int status = zcm_unsubscribe (zcm, hid->z_sub);
    if (0 != status) {
        fprintf(stderr,
           "couldn't unsubscribe ZcmLidarLuxObject_handler %p!\n", hid);
        return -1;
    }
    free (hid);
    return 0;
}

